window.bookSummaryJSON = "<p>When a teenager goes missing from the Beacon of Hope School, Texas Ranger Wyatt Sheridan and school director Kate Winslow are forced into a dangerous struggle against a human trafficking organization. But the battle brings dire consequences as Wyatt's daughter is terrorized, and Kate is kidnapped. Now it's personal, and Wyatt finds both his faith and his investigative skills challenged as he fights to discover the mastermind behind the ring before evil destroys everyone he loves. </p>"; 
